  false,\n\t\"url\": null,\n\t\"notes\": \"Gridded bathymetry and IKONOS estimated
  depths of the shelf and slope environments of Northampton Seamounts to Laysan Island,
  Northwestern Hawaiian Islands, Hawaii, USA. Bottom coverage was achieved in depths
  between 0 and 1500 meters. The NetCDF includes multibeam bathymetry from the Simrad
  EM1002, Simrad EM120 multibeam sonars collected as of October 2006 by the NOAA Coral
  Reef Ecosystem Division in depths between 20 and 5000 meters. The netCDF also includes
  estimated depths derived from high resolution IKONOS satellite imagery by the NOAA/NOS/NCCOS/CCMA
  Remote Sensing Team in shallow water between 0 and 16 meters.\",\n\t\"license_title\":
